import React from 'react';
import { Typography } from '@material-ui/core';

const ErrorComponent = ({ errorMessage }) => {
  return (
    <>
      <Typography>{`Error - ${errorMessage}`}</Typography>
    </>
  );
};

export default ErrorComponent;
